import { post, _delete } from '@/lin/plugin/axios'

class FunctionStatis {
  async searchFuncList(data) {
    const res = await post('/statistical/func/list', data)
    return res
  }

  async updateFunc(data) {
    const res = await post('/statistical/func/update', data)
    return res
  }

  async deleteFunc(id) {
    const res = await _delete(`/statistical/func/${id}`)
    return res
  }

  async statistic(data) {
    const res = await post('/statistical/func/statis', data)
    return res
  }

  async doEfficiency(data) {
    const res = await post('/statistical/func/efficiency', data)
    return res
  }
}

export default new FunctionStatis()
